import React from "react";

const Category = (props) => {
  return (
    <section>
      <div className="container">
        <div className="row">
          <div className="col-lg-4">
            <img src={props.poster} />
          </div>
          <div className="col-lg-8">
            <h4>Judul : {props.title}</h4>
            <p>Tahun Rilis : </p>
            <p>{props.year}</p>
            <p>Sinopsis :</p>
            <p>{props.synopsis}</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Category;
